    const subsectorColors = [

    function getRandomColor(list) {
        return list[Math.floor(Math.random() * list.length)];
    }

    function sectorStyle(f) {
        const index = f.properties.index % sectorColors.length;
        return {
            fillColor: 'none',
            color: sectorColors[index],
            weight: 4,
            opacity: 1,
            dashArray: '4, 4',
            fillOpacity: 0
        };
    }

    function subsectorStyle(f) {
        if (!f.properties.fillColor)
            f.properties.fillColor = getRandomColor(subsectorColors);
        return {
            fillColor: f.properties.fillColor,
            color: '#444',
            weight: 2,
            opacity: 1,
            fillOpacity: 0.6,
            dashArray: '4, 3'
        };
    }

    function onEachFeature(feature, layer) {

        const tooltip = p["Subsector Name"] ?

            `<strong>${p["Sector Name"]}</strong>`;
        layer.bindTooltip(tooltip);

        if (p.type === "sector") {
            sectorLayers[p["Sector Name"]] = layer;
        } else {
            if (!subsectorLayers[p["Sector Name"]]) {
                subsectorLayers[p["Sector Name"]] = {};
            }
            subsectorLayers[p["Sector Name"]][p["Subsector ID"]] = layer;
        }
    }

                const layer = subsectorLayers[sec][id];
                if (sec === selected) {
                    layer.setStyle({ fillOpacity: 0.6, weight: 2, opacity: 1 });
                    const name = layer.feature.properties["Subsector Name"];
                    const opt = document.createElement("option");
                    opt.value = id;
                    opt.textContent = name;
                    subDropdown.appendChild(opt);
                } else {
                    layer.setStyle({ fillOpacity: 0, weight: 0, opacity: 0 });
                }
            }
        }

        if (selected && sectorLayers[selected]) {
            map.fitBounds(sectorLayers[selected].getBounds());
        }
    });

    document.getElementById("subsectorSelect").addEventListener("change", function () {
        const selected = this.value;
        const sector = document.getElementById("sectorSelect").value;

        if (highlightedSubsector) {
            highlightedSubsector.setStyle(subsectorStyle(highlightedSubsector.feature));
        }

        for (const sec in subsectorLayers) {
            for (const id in subsectorLayers[sec]) {
                subsectorLayers[sec][id].setStyle({ fillOpacity: 0, weight: 0, opacity: 0 });
            }
        }

        if (selected && sector && subsectorLayers[sector][selected]) {
            const layer = subsectorLayers[sector][selected];
            layer.setStyle({ fillOpacity: 0.9, weight: 3, color: '#000', opacity: 1 });
            map.fitBounds(layer.getBounds());
            highlightedSubsector = layer;
        }
    });

    function resetMap() {
        document.getElementById("sectorSelect").value = "";
        document.getElementById("subsectorSelect").innerHTML = "<option value=''>Select Subsector</option>";
        document.getElementById("toggleBoundaries").checked = true;

        for (const name in sectorLayers) {
            sectorLayers[name].setStyle({ opacity: 1, weight: 4, fillOpacity: 0 });
        }
        for (const sec in subsectorLayers) {
            for (const id in subsectorLayers[sec]) {
                subsectorLayers[sec][id].setStyle(subsectorStyle(subsectorLayers[sec][id].feature));
            }
        }
        highlightedSubsector = null;
        map.setView([25.2, 55.3], 10);
    }
    </script>
</body>
</html>
